import { Component } from 'react';
import './App.css';

import Handlebars from "handlebars";

const html = `<div id="board">
                {{#each cells}}\
                  {{#if link}}\
                    <a href={{link}}><div class="cell {{clazz}}">{{text}}</div></a>\
                  {{else}}\
                    <div class="cell {{clazz}}">{{text}}</div>\
                  {{/if}}\
                {{/each}}\
              </div>\
              <div id="bottombar">\
                <a href="/newgame"><button>New Game</button></a>\
                <button>Undo</button>\
              </div>`;
const template = Handlebars.compile(html);

const data = {
  cells: [{ text: "", clazz: "playable", link: "/play?x=0&y=0"},{ text: "", clazz: "playable", link: "/play?x=1&y=0"},{ text: "", clazz: "playable", link: "/play?x=2&y=0"}]
};

interface AppState {
  json: JSON
};

class App extends Component<{}, AppState> {
  constructor() {
    super({});
    this.state = {
      json: JSON.parse('{"test": "test"}')
    }
  }

  async componentDidMount() {
    const response = await fetch('http://localhost:3000/test');
    const r2 = await fetch('newgame');
    const j = await r2.json();
    this.state = {
      json: j
    }
    console.log(j);
  }


  render() {
    console.log("HELLO");
    return (
      <div className="App">
        <div dangerouslySetInnerHTML={{ __html: template(this.state.json) }} />
      </div>
    );
  }
}

export default App;
